%[text] ## UOP Post-Equatorialized Orbit
% The following parameters were obtained from visual inspection of the final equatorialized trajectory shown in the UOP mission concept appendix c
% source: https://science.nasa.gov/wp-content/uploads/2023/10/uranus-orbiter-and-probe-appendix-c.pdf

r_a = 1.6625e+06; % apoapsis [km]
r_p = 1.25e+05; % periapsis [km]
major = r_p + r_a; % major axis [km]
a = major/2; % semi-major axis [km]
epsilon = 1 - (r_p/a); % eccentricity
F = 0-2*(a-r_p); % second ellipse focus (for plotting)
p = r_p*(1 + epsilon); % semilatus rectum
H = sqrt(p*mu_Uranus); % angular momentum of orbit [kg*m^2/s]
V_p = H/r_p  %[output:43eb7d55]
V_a = H/r_a %[output:738d5c62]
P_UOP = 2*pi*sqrt(a^3/mu_Uranus)/60/60/24; % Period of orbit [days]

%%
%[text] ## Sphere of influence
% Sphere of Influece calculation - how close do we need to be to Ariel to
% be within its SOI?

GM_Ariel = 83.43; % [km^3/s^2]
V_esc_Ariel = sqrt(2*GM_Ariel/r_ar + 35) %[output:9894eef8]

a_SOI = (r_ar_orb) %[output:5d83f825]
r_SOI_Ar = a_SOI*(((12.9*10^20)/(86.811*10^24))^(2/5)) %[output:5880ae52]
%%
%[text] ## Impulsive Tangential Burn Calculations
% Initial Elliptical Orbit to Moons/Rings
% Apoapsis burn to reduce periapsis

% Ariel
[Ariel_delta_v, CRISPI_V_p, period_initial_UOP, period_final_Ariel] = CalculateDeltaVPeriapsis(r_p, (r_ar_orb - r_ar - 35), r_a) %[output:5691735b] %[output:8b178fdd] %[output:79c532a3] %[output:5557500e] %[output:6d81b377]
V_flyby_Ariel = abs(V_ar_orb - CRISPI_V_p ) %[output:801e0f17]
Ariel_delta_v_total = Ariel_delta_v + abs(7 - V_flyby_Ariel) %[output:06f83e60]

% Miranda
[Miranda_delta_v, CRISPI_V_p, period_initial_UOP, period_final_Miranda] = CalculateDeltaVPeriapsis(r_p, (r_mir_orb + r_mir + 35), r_a) %[output:926bb91f] %[output:6b9862d6] %[output:993470d4] %[output:6f48592c] %[output:9520877c]
V_flyby_Miranda = abs(V_mir_orb - CRISPI_V_p ) %[output:2f118837]
Miranda_delta_v_total = Miranda_delta_v + abs(7 - V_flyby_Miranda) %[output:4cde39b8]

% Mab
[Mab_delta_v, CRISPI_V_p, period_initial_UOP, period_final_Mab] = CalculateDeltaVPeriapsis(r_p, r_mu, r_a) %[output:2a87e79e] %[output:065fdf19] %[output:0465e793] %[output:53d7103b] %[output:58a946db]
