%legend('UOP','Uranus','Oberon Orbit','Titania Orbit','Umbriel Orbit','Ariel Orbit','Miranda Orbit','Mu Ring Outer Range')
%legend('UOP','Uranus','Ariel','Miranda Orbit')

%[text] ## Early crossover flyby
disp('early crossover flyby') %[output:35ce05c4]
delta_v = -0.5 %[output:977410b9]
E_orbit = (((V_a + delta_v)^2)/2) - ((mu_Uranus)/r_a) %[output:49389259]
V_crossover_Ariel = sqrt(2*(E_orbit+(mu_Uranus/r_ar_orb))) %[output:89369eb6]
H = r_a*(V_a + delta_v) %[output:31f6a0d3]
p = H^2/mu_Uranus %[output:5e258791]
epsilon_new = 1 - p/r_a %[output:6a533ea3]
a = r_a/(epsilon_new+1) %[output:017c98e0]
nu_Ariel = acos((1/epsilon_new)*(((a*(1-epsilon_new^2))/(r_ar_orb))-1)) %[output:782a75a4]
nu_deg = rad2deg(nu_Ariel) %[output:9d770d5b]
r_p_at_Ariel = a/(1-epsilon_new) %[output:4ee040a6]
phi = acos((1+epsilon_new*cos(nu_Ariel))/(sqrt(1+2*epsilon_new*cos(nu_Ariel)+epsilon_new^2))) %[output:08c95486]
% c = sqrt(r_p_at_Ariel^2+r_ar_orb^2-(2*r_p_at_Ariel*r_ar_orb*cos(nu_Ariel)))
% angle = asin(r_p_at_Ariel*sin(nu_Ariel)/c)
V_rel_perp = sin(phi)*V_crossover_Ariel %[output:3e1bb0cc]
V_rel_tan = cos(phi)*V_crossover_Ariel %[output:9ca5a4ee]
P_flyby = 2*pi*sqrt(a^3/mu_Uranus)/60/60/24 % Period of orbit [days] %[output:702b3044]

% Time of flight to flybly Ariel
u_cross = acos((epsilon_new+cos((nu_Ariel)))/(1+epsilon_new*(cos(nu_Ariel)))) %[output:16f13c55]
M_cross = u_cross - epsilon_new*sin(u_cross) %[output:2f56c270]
tof_CRISPI = (P_flyby/(2*pi))*(M_cross) %[output:54d0e944]
tof_CRISPI_from_apo = P_flyby/2 - (P_flyby/(2*pi))*(M_cross) %[output:77fe4934]

M_UOP = linspace(0,2*pi,1000);
[E_UOP, nu_UOP] = invKepler(M_UOP,epsilon) %[output:3c996a7c] %[output:5f9437a4]

[x_new, y_new] = CalculateOrbit(1, a, epsilon_new, 0);
plot(x_new, y_new) %[output:867f0c60]
legend('UOP','Uranus','Oberon Orbit','Titania Orbit','Umbriel Orbit','Ariel Orbit','Miranda Orbit','Mu Ring Outer Range','CRISPI Orbit','Location','NorthWest') %[output:867f0c60]

