%[text] ## Impulsive Burn Function - Change Periapsis Altitude (Uranus Orbit)
% This function calculates the delta V required for an impulsive burn at
% apoapsis to change the altitude of the orbit at periapsis

% Inputs: 
    % r_p_initial: The initial periapsis of the orbit
    % r_p_final: The desired periapsis of the orbit
    % r_a = The initial apoapsis of the orbit (this should not change)
% Outputs:
    % delta_v: Delta V required for apoapsis burn
    % V_p_new: New periapsis velocity
    % period_initial: Period of original orbit
    % period_final: Period of final orbit

    function [delta_v, V_p_new, period_initial, period_final] = CalculateDeltaVPeriapsis(r_p_initial, r_p_final, r_a)
mu_Uranus = 5.7940e+06; % Gravitational constant [km^3/s^2]

% Old orbit
a_old = (r_p_initial + r_a)/2;
eps_old = 1 - (r_p_initial/a_old);
p_old = a_old*(1-eps_old^2);
H_old = sqrt(p_old*mu_Uranus);
V_a_old = H_old/r_a;
V_p_old = H_old/r_p_initial;

% New orbit
a_new = (r_p_final + r_a)/2;
eps_new = 1 - (r_p_final/a_new);
p_new = a_new*(1-eps_new^2);
H_new = sqrt(p_new*mu_Uranus);
V_a_new = H_new/r_a;
V_p_new = H_new/r_p_final

% Delta V
delta_v = abs(V_a_old - V_a_new);

% Period of Orbit
period_initial = 2*pi*sqrt(a_old^3/mu_Uranus)/60/60/24;
period_final = 2*pi*sqrt(a_new^3/mu_Uranus)/60/60/24;

end
%[text] ## Impulsive Burn Function - Change Apoapsis Altitude (Uranus Orbit)
% This function calculates the delta V required for an impulsive burn at
% periapsis to change the altitude of the orbit at apoapsis

% Inputs: 
    % r_a_initial: The initial apoapsis of the orbit
    % r_a_final: The desired apoapsis of the orbit
    % r_p = The initial periapsis of the orbit (this should not change)
% Outputs:
    % delta_v: Delta V required for periapsis burn
    % period_initial: Period of original orbit
    % period_final: Period of final orbit

function [delta_v, period_initial, period_final] = CalculateDeltaVApoapsis(r_a_initial, r_a_final, r_p)
mu_Uranus = 5.7940e+06; % Gravitational constant [km^3/s^2]

% Old orbit
a_old = (r_a_initial + r_p)/2;
eps_old = (r_a_initial/a_old) - 1;
p_old = a_old*(1-eps_old^2);
H_old = sqrt(p_old*mu_Uranus);
V_p_old = H_old/r_p;
V_a_old = H_old/r_a_initial;

% New orbit
a_new = (r_a_final + r_p)/2;
eps_new = (r_a_final/a_new) - 1;
p_new = a_new*(1-eps_new^2);
H_new = sqrt(p_new*mu_Uranus);
V_p_new = H_new/r_p;
v_a_new = H_old/r_a_final;

% Delta V
delta_v = abs(V_p_old - V_p_new);

% Period of Orbit
period_initial = 2*pi*sqrt(a_old^3/mu_Uranus)/60/60/24;
period_final = 2*pi*sqrt(a_new^3/mu_Uranus)/60/60/24;

end

